DROP TABLE IF EXISTS `user_designer`;
CREATE TABLE `user_designer` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `mid` char(32) NOT NULL COMMENT '用户长id',
  `designer_no` varchar(32) NOT NULL DEFAULT '' COMMENT '庭好编号',
  `real_name` varchar(32) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '设计师全名',
  `nickname` varchar(32) DEFAULT NULL COMMENT '用户昵称',
  `nickname_type` tinyint(4) unsigned NOT NULL DEFAULT '0' COMMENT '个人店铺昵称是否显示：0-不显示；1-显示（真实姓名隐藏）',
  `pic` varchar(128) DEFAULT '' COMMENT '头像标识',
  `city` int(11) NOT NULL DEFAULT '0' COMMENT '城市代码',
  `native_provice` int(11) NOT NULL DEFAULT '0' COMMENT '籍贯省代码',
  `native_city` int(11) NOT NULL DEFAULT '0' COMMENT '籍贯城市代码',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '类型：1-收费|0免费',
  `role_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '设计师类型：0硬装设计师 1软装设计师 2硬装+软装设计师',
  `adept_style` varchar(300) DEFAULT NULL COMMENT '擅长风格(多选)--base64_encode(json_encode(array)),键为风格的键，值为风格名称，详见配置id=16',
  `level` tinyint(4) NOT NULL DEFAULT '1' COMMENT '等级:1-1级|2-2级',
  `agencies_mid` varchar(32) NOT NULL DEFAULT '0' COMMENT '挂靠机构长id,默认0平台',
  `agencies_name` varchar(64) NOT NULL DEFAULT '创客设计师' COMMENT '挂靠机构全称',
  `sex` tinyint(4) DEFAULT '0' COMMENT '性别:0-保密|1-男|2-女',
  `margin` int(11) DEFAULT '0' COMMENT '保证金，单位分',
  `ptime` tinyint(4) DEFAULT '1' COMMENT '工期换算:1-金额|2-面积',
  `ptime_remark` varchar(512) DEFAULT NULL COMMENT '工期换算明细;base64_encode(json_encode(array))',
  `design_concept` varchar(512) DEFAULT '这个家伙很懒~什么都没有留下~' COMMENT '设计理念',
  `convention` varchar(512) DEFAULT NULL COMMENT '设计要求',
  `charge` int(11) NOT NULL DEFAULT '0' COMMENT '收费标准：单位元',
  `last_update_time` date DEFAULT NULL COMMENT '收费标准更改时间',
  `work_year` tinyint(4) NOT NULL DEFAULT '1' COMMENT '从业年限',
  `entrust_num` int(11) NOT NULL DEFAULT '0' COMMENT '累计接单数',
  `over_num` int(11) DEFAULT '0' COMMENT '设计订单收图后累计单数',
  `success_num` int(11) NOT NULL DEFAULT '0' COMMENT '转施工数',
  `fans_num` int(11) DEFAULT '0' COMMENT '粉丝数量',
  `vr_num` int(11) NOT NULL DEFAULT '0' COMMENT 'vr方案数量',
  `case_num` int(11) NOT NULL DEFAULT '0' COMMENT '晒图晒家案例数',
  `collect_num` int(11) NOT NULL DEFAULT '0' COMMENT '被收藏数',
  `click_num` int(11) NOT NULL DEFAULT '0' COMMENT '点击量(用户主页查看联系方式的次数)',
  `cback` decimal(10,4) NOT NULL DEFAULT '0.0000' COMMENT '退单率：单位是0.01',
  `accept` smallint(5) NOT NULL DEFAULT '10000' COMMENT '交流认可度：1是0.01%',
  `avg_score` smallint(5) NOT NULL DEFAULT '500' COMMENT '平均评分：单位0.01，100=1分',
  `budget` tinyint(4) NOT NULL DEFAULT '45' COMMENT '预算控制,单位0.1(转施工后)',
  `quality` tinyint(4) NOT NULL DEFAULT '45' COMMENT '设计品质,单位0.1',
  `service` tinyint(4) NOT NULL DEFAULT '45' COMMENT '服务配合,单位0.1',
  `score` tinyint(4) NOT NULL DEFAULT '45' COMMENT '综合评论分数,单位0.1',
  `identity` varchar(32) DEFAULT NULL COMMENT '身份证号',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '实名认证状态:2-已认证|1-待认证|0-认证未通过',
  `offline_maigin` int(11) DEFAULT '0' COMMENT '线下保证金（单位分）',
  `account_type` tinyint(3) DEFAULT '2' COMMENT '1-普通用户，2-试用用户，3-D客设计师',
  `receive_win_power` tinyint(1) NOT NULL DEFAULT '1' COMMENT '领取D客方案开关，普通账户（account_type=1）有效，1-可领取 0-放弃领取',
  `is_fine` tinyint(4) DEFAULT '0' COMMENT '城运推荐是否优秀：0-非优秀|1-优秀',
  `home_display` varchar(255) DEFAULT NULL COMMENT '业主app首页数据展示内容和排序：（1,2,3,4,5,6,7），数字含义：1-总浏览量|2-本月成交额|3-新订单|4-待付款|5-待评价|6-今日成交额|7-昨日成交额|8-设计中|9-总设计数|10-今日访客|11-历史访客|12-客户收藏|13-月查看联系数|14-分享注册|15-邀请业主数|16-邀请业者数',
  `is_up_soft` tinyint(3) DEFAULT '0' COMMENT '0设计师账号没有同步软件方 1已同步',
  `start_time` datetime DEFAULT NULL COMMENT '试用账号开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '试用账号结束时间',
  `soft_pay_time` datetime DEFAULT NULL COMMENT '设计师软件缴费时间',
  `charge_time` datetime DEFAULT NULL COMMENT '设计费变更时间',
  `view_num` int(11) NOT NULL DEFAULT '0' COMMENT '浏览数',
  `conversion` smallint(5) NOT NULL DEFAULT '50' COMMENT '转单力,单位0.1',
  `back_num` int(11) NOT NULL DEFAULT '0' COMMENT '退单数',
  `create_time` datetime NOT NULL COMMENT '表添加时间',
  `update_time` datetime NOT NULL COMMENT '表修改时间',
  `last_synch_wx_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最后同步装企小程序的时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `designer_no` (`designer_no`),
  UNIQUE KEY `mid` (`mid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=709 DEFAULT CHARSET=utf8 COMMENT='设计师信息表';

-- ----------------------------
-- Records of user_designer
-- ----------------------------
