INSERT INTO `user_designer` VALUES ('124', 'dff55bbb560519c44a8ba05822c506c6', '201709050871110000', '赵美霞', '13888457510', '0', '59ae597234e90.jpg', '320400', '530000', '532900', '1', '0', null, '1', '07b8fac62286ae21f438f40bb7a5e441', '昆明中策装饰（集团）有限公司', '2', '0', '2', 'eyIwLTEwMCI6IjMiLCIxMDEtMTUwIjoiNSIsIjE1MS0yMDAiOiI3IiwiMjAxLTI1MCI6IjEwIiwiMjUxLTMwMCI6IjE1IiwiMzAwIjoiMjAifQ==', '设计源于生活，更应该贴近生活。让每一个空间表情既满足客户所求，又传达一种独特的艺术美感。\r\n \r\n\r\n', '0', '0', null, '15', '0', '0', '0', '1', '0', '7', '1', '0', '0.0000', '10000', '500', '45', '45', '45', '45', '532901198206221827', '2', '0', '1', '1', '0', null, '0', null, null, '0000-00-00 00:00:00', null, '150', '50', '0', '2017-09-05 15:24:22', '2019-07-15 15:46:52', '0000-00-00 00:00:00');
