INSERT INTO `user_designer` VALUES ('126', 'ca91ff74aa86bb980dfc1d27376b5f8d', '201709050871110002', '王新勇', '13888325558', '0', '5a178003c85f1.jpg', '320400', '510000', '510800', '1', '0', null, '1', '07b8fac62286ae21f438f40bb7a5e441', '昆明中策装饰（集团）有限公司', '1', '0', '2', 'eyIwLTEwMCI6IjMiLCIxMDEtMTUwIjoiNSIsIjE1MS0yMDAiOiI3IiwiMjAxLTI1MCI6IjEwIiwiMjUxLTMwMCI6IjE1IiwiMzAwIjoiMjAifQ==', '做有意义的设计、摒弃一切没有理论支撑的多余的元素、反对盲目堆砌与拼凑；做可以与人一起成长的空间；赋予空间文化内涵，与灵魂', '0', '0', null, '13', '0', '0', '0', '0', '0', '3', '0', '0', '0.0000', '10000', '500', '45', '45', '45', '45', '510823198302140557', '2', '0', '1', '1', '0', null, '0', null, null, '0000-00-00 00:00:00', null, '78', '50', '0', '2017-09-05 15:25:22', '2019-07-12 14:28:52', '0000-00-00 00:00:00');
INSERT INTO `user_designer` VALUES ('127', 'd73cdef1c662e259916482fed19c84ef', '201709050871110003', '张艳芬', '15987115516', '0', '5a167c1b16c01.jpg', '320400', '530000', '530100', '1', '0', null, '1', '07b8fac62286ae21f438f40bb7a5e441', '昆明中策装饰（集团）有限公司', '2', '0', '2', 'eyIwLTEwMCI6IjMiLCIxMDEtMTUwIjoiNSIsIjE1MS0yMDAiOiI3IiwiMjAxLTI1MCI6IjEwIiwiMjUxLTMwMCI6IjE1IiwiMzAwIjoiMjAifQ==', '设计理念：\r\n  住十年不过时，方为大设计；住十年不会乱，方为懂生活\r\n 张艳芬， 毕业于昆明大学建筑装潢与设计专业，2005年1月至今就职于中策装饰（集团）有限公司，先后赴香港、澳门、上海、广州，迪拜，法国，意大利，泰国，老挝等国内外考察学习，现任云南中策装饰（集团）高级主任设计师，中国建筑学会室内设计分会会员\r\n从事设计13余年，致力于研究好看，好住，好运的家居生活设计，让客户的家成为幸福的基地，让身体和心灵都找到归属和依靠，关爱每一个爱家的人\r\n荣誉及奖项： \r\n2008——2017年数十套设计案例选登设计类书籍《设计家》\r\n2012年案列《泸西锦辉铭苑》选登《设计速递  写意东方》，并长期为精品文化出版社长期提供作品\r\n2011年荣获中国室内.金堂奖年度“优秀”住宅公寓设计\r\n2011年荣获中国室内.金堂奖年度“十佳”住宅公寓设计\r\n2013年荣获云南省首届“宽厚长”杯装饰设计大赛铜奖\r\n2014年荣获中国室内.金堂奖年度“优秀”别墅设计\r\n2014年荣获金装奖—中国（云南）室内设计总评榜家装工程类银奖\r\n2014年荣获第五届“红土奖”室内设计大赛工程类优秀奖\r\n2015年在杂志发表《小户型设计要素》', '0', '0', null, '13', '0', '0', '0', '0', '0', '12', '1', '0', '0.0000', '10000', '500', '45', '45', '45', '45', '532231198409233326', '2', '0', '1', '1', '0', null, '0', null, null, '0000-00-00 00:00:00', null, '110', '50', '0', '2017-09-05 15:25:52', '2019-07-10 17:19:06', '0000-00-00 00:00:00');
