INSERT INTO `user_designer` VALUES ('165', 'fd1024fac298ab758f26e606114754bd', '201709210951110000', '马彦军', '15296918245', '0', '59c3be47d4b24.jpg', '320400', '640000', '640100', '0', '0', null, '1', '0', '创客设计师', '1', '0', '2', 'eyIwLTEwMCI6IjMiLCIxMDEtMTUwIjoiNSIsIjE1MS0yMDAiOiI3IiwiMjAxLTI1MCI6IjEwIiwiMjUxLTMwMCI6IjE1IiwiMzAwIjoiMjAifQ==', '不需要华丽的语言来塑造我们可能并不存在的生活方式，我们需要的只是回归。 回归于那 知命之年，孩子成家立业，孙子健康活泼，父母安康，家业不断升华享受着成功健 康休闲的生活状态。在冰冷的装修材质中我们希望看到的是处处充满着天伦之乐的祥和氛围 一家人享受四世同堂带来的美满幸福。', '0', '0', null, '8', '4', '0', '0', '0', '0', '1', '2', '0', '0.0000', '10000', '500', '45', '45', '45', '45', '622901198603010013', '2', '0', '1', '1', '0', null, '0', null, null, '0000-00-00 00:00:00', null, '102', '50', '0', '2017-09-21 21:25:58', '2019-02-21 11:16:23', '0000-00-00 00:00:00');
