INSERT INTO `user_designer` VALUES ('173', 'eed7b3443700316cd388e567d99a7a04', '201710080757110000', '刘宣', '18520904609', '0', '5a27c124a7a82.jpg', '320400', '430000', '430400', '1', '0', null, '1', '0', '创客设计师', '1', '0', '2', 'eyIwLTEwMCI6IjMiLCIxMDEtMTUwIjoiNSIsIjE1MS0yMDAiOiI3IiwiMjAxLTI1MCI6IjEwIiwiMjUxLTMwMCI6IjE1IiwiMzAwIjoiMjAifQ==', '室内设计注重材料的选择，注重品牌、质感，因此更为理性实用 因生活面设计，因设计而美好。\r\n把东西合理的利用，为每位辛苦者的世人设计一个健康、舒适、安逸的生活环境创造未来，领选于时代潮流。人为生活而设计，设计为生活而存在。艺术源于生活，而生活是艺术的来源，在生活中追求艺术之美的存在。 当人们的空间被各种物质挤压的时候，也就失去了本质，我们要去掉一切虚假的、表面的、无用的东西，而剩下真实的、本质的、必不可少的东西，因而得到更多的空间、更多的舒适、更多的效率、更多的美……', '0', '0', null, '5', '0', '0', '0', '0', '0', '0', '5', '0', '0.0000', '10000', '500', '45', '45', '45', '45', '430421199109254333', '2', '0', '1', '1', '0', null, '0', null, null, '0000-00-00 00:00:00', null, '145', '50', '0', '2017-10-08 07:44:25', '2019-05-31 15:26:28', '0000-00-00 00:00:00');
